(118, 'Mastering Cloud Development with AWS', 'This in-depth, three-day workshop will equip you with the skills to build, deploy, and manage applications on the Amazon Web Services (AWS) cloud platform. You\'ll learn about core AWS services like EC2, S3, DynamoDB, and Lambda, along with best practices for security, scalability, and cost optimization. Hands-on labs will solidify your understanding and get you started on your cloud development journey. Whether you\'re a beginner or looking to expand your cloud expertise, this workshop is for you.', 'Online (Zoom) & In-Person (New York City)', '2024-07-25 09:00:00', '2024-07-27 17:00:00', '2024-07-10 10:00:00', '2024-07-24 18:00:00', 'Online', 100, '[\"Python\",\"Java\",\"JavaScript\",\"C\\/C++\",\"AWS\",\"DevOps\"]', '\"Cloud Academy\"', NULL, '2024-06-17 14:48:40'),
(119, 'Demystifying Blockchain: Applications &amp; Future Potential', 'Join us for this exciting two-day conference exploring the world of blockchain technology. Renowned experts will delve into the fundamentals of blockchain, its diverse applications across industries like finance, supply chain, and healthcare, and its potential to revolutionize the future. Interactive sessions, panel discussions, and networking opportunities will provide valuable insights and foster connections within the blockchain community. This conference is ideal for anyone curious about blockchain, from beginners to seasoned professionals.', 'San Francisco Convention Center', '2024-09-18 08:30:00', '2024-09-19 18:00:00', '2024-08-01 09:00:00', '2024-09-17 12:00:00', 'Online', 500, '[\"Python\",\"Java\",\"JavaScript\",\"C\\/C++\",\"Blockchain\"]', '\"Global Tech Summit\"', NULL, '2024-06-17 14:48:47'),
(120, 'Mastering Deep Learning Techniques for Computer Vision', 'This intensive, six-week specialization program delves into advanced deep learning techniques for computer vision applications. Led by leading researchers and practitioners, the program covers convolutional neural networks (CNNs), object detection, image segmentation, and generative models. Through lectures, hands-on projects, and interactive discussions, you\'ll gain the expertise to build and deploy cutting-edge computer vision systems. Due to the intensive nature of the program, seats are limited. Apply now to secure your spot!', 'Online & In-Person (Los Angeles)', '2024-10-15 10:00:00', '2024-11-23 12:00:00', '2024-09-01 00:00:00', '2024-10-14 23:59:00', 'Physical', 25, '[\"Python\",\"Java\",\"JavaScript\",\"C\\/C++\",\"Deep Learning\",\"Computer Vision\"]', '\"Institute of Artificial Intelligence\"', NULL, '2024-06-17 14:48:51'),
(121, 'Design Thinking for Innovation: A Practical Guide for Entrepreneurs', 'This immersive, one-day workshop equips aspiring entrepreneurs with the power of design thinking, a human-centered approach to problem-solving and innovation. Through interactive exercises and case studies, you\'ll learn the core design thinking framework: empathize, define, ideate, prototype, and test. You\'ll develop your creative problem-solving skills, discover new opportunities in your target market, and gain practical tools to validate your business ideas.  This workshop is ideal for early-stage entrepreneurs, product managers, and anyone looking to cultivate an innovative mindset. Seats are limited, so register early to secure your spot!', 'Silicon Valley Innovation Center', '2024-08-09 09:00:00', '2024-08-09 17:00:00', '2024-07-15 10:00:00', '2024-08-08 12:00:00', 'Hybrid(Physical or Online)', 30, '[\"Python\",\"Java\",\"JavaScript\",\"C\\/C++\"]', '\"Startup Launchpad\"', NULL, '2024-06-17 14:49:50'),
(122, 'Full-Stack Web Development Bootcamp: Build Real-World Applications', 'This comprehensive, two-month bootcamp equips you with the skills to become a full-stack web developer. You\'ll gain a solid foundation in both front-end and back-end technologies, including HTML, CSS, JavaScript, React.js, Node.js, Express.js, and databases like MongoDB. Through a project-based curriculum, you\'ll tackle real-world challenges, building your portfolio while mastering essential web development skills. Weekly live sessions with experienced instructors, along with a supportive online community, will guide you through your learning journey. No prior programming experience is required, just a passion for building things for the web! This immersive bootcamp is your gateway to a fulfilling career as a full-stack web developer.', 'Online (Live Sessions) & Self-Paced Learning', '2024-09-23 18:00:00', '2024-11-22 20:00:00', '2024-08-10 00:00:00', '2024-09-22 23:59:00', 'Online', 75, '[\"Python\",\"Java\",\"JavaScript\",\"C\\/C++\",\"Ruby\",\"React.js\"]', '\"Codemasters Academy\"', NULL, '2024-06-17 14:50:29'),
(123, 'Blockchain Summit 2024', 'Dive deep into the world of blockchain technology. Learn about decentralized finance (DeFi), smart contracts, and the future of cryptocurrencies from industry pioneers and blockchain developers.', 'New York Marriott Downtown', '2024-11-15 09:30:00', '2024-11-16 17:00:00', '2024-10-01 00:00:00', '2024-11-10 23:59:59', 'Online', 400, '[\"Python\",\"Java\",\"JavaScript\",\"Blockchain\"]', '\"Crypto Innovations Group\"', NULL, '2024-06-17 14:55:43'),
(124, 'DevOps World 2024', 'Explore the latest practices and tools in DevOps. From continuous integration and delivery (CI/CD) pipelines to containerization with Docker and Kubernetes, this event is a must for DevOps professionals.', 'Chicago Tech Center', '2024-10-05 08:30:00', '2024-10-07 17:30:00', '2024-09-01 00:00:00', '2024-10-01 23:59:59', 'Physical', 500, '[\"Python\",\"Java\",\"JavaScript\",\"DevOps\",\"Containers\",\"CI\\/CD\"]', '\"DevOps Community Inc.\"', NULL, '2024-06-17 14:55:48'),
(125, 'AI Ethics Symposium', 'Delve into the ethical implications of artificial intelligence. Discuss topics such as bias in AI algorithms, data privacy, and responsible AI deployment strategies with experts and thought leaders.', 'Washington State University', '2024-09-20 13:00:00', '2024-09-21 18:00:00', '2024-08-01 00:00:00', '2024-09-15 23:59:59', 'Hybrid(Physical or Online)', 300, '[\"Python\",\"Java\",\"JavaScript\",\"Machine Learning Algorithms\",\"AI Ethics\"]', '\"Ethical AI Society\"', NULL, '2024-06-17 14:55:54'),
